import React from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import CreateUser from "./createUser";
import Login from "./login";





function Auth() {

    return (
        <Router>
            <Switch>

                <Route path="/login">
                    <Login></Login>
                </Route>

                <Route path="/register">
                    <CreateUser></CreateUser>
                </Route>

            </Switch>
        </Router>
    );

}

export default Auth;
